import Layout from "../components/Layout";
import styles from '../styles/index.module.css';

// components/Tile.js

const Home = () => (
    <Layout>
        {
        <main>
            <div className={styles.mainContainer}></div>
                <div className={styles.main}>
                <h1>hello there its jason bourne</h1>


                </div>

        </main>
        }
    </Layout>
);

export default Home;
